通话录音音频剪辑录音转文字小助手

专业的录音及录音转文字软件。千万用户的选择，满足您在不同场景的录音需求!
记录会议?演讲?采访?上课?证据?灵感? .. .或者录下您的整个世界?
[非常适合以下人群使用]
@文职一各类大小会议，一键录音转文字，轻松搞定会议记录;
@商务-业务洽谈、合作沟通，全程清晰记录，便捷整理关键信息;
@记者一现场采访、人物访谈，边录边转文字，输出稿子快人一步;
@学生一.上课走神遗漏的、来不及记的重要知识点，录音及转文字帮你弥补!
[实用特色功能早知道]
》录音转文字一支持即时音频以及本地存储的音频"享受"转文字服务;
》录音剪辑一支持多段选择、灵活剪辑
》录音倍速播放一可调播放快慢、还可边看文字边听录音
》录音云端存储 一支持云端机密存储， 防丢失，防误删


【录音专家VIP自动订阅服务说明】
1、订阅服务：录音专家VIP连续包周（1个周）、录音专家VIP连续包月（1个月）、录音专家VIP连续包年（12个月）
2、订阅价格：连续包周产品为15元/周，连续包月产品为28元/月，连续包年产品为188元/年
3、付款：用户确认购买并付款后计入iTunes账户
4、苹果iTunes账户会在到期前24小时内扣费，扣费成功后订阅周期顺延一个订阅周期
5、如需取消订阅，请打开苹果手机“设置”－－进入“iTunes Store 与 App Store”－－点击“Apple ID”，选择＂查看Apple ID",进入＂账户设置＂页面，点击“订阅”，选择录音专家VIP 取消订阅。如在订阅期结束的至少24小时前关闭订阅，此订阅将会自动续订
6、用户协议：https://copy-book.oss-cn-hangzhou.aliyuncs.com/link/LuyinTu/User-agreement.html
7、隐私协议：https://copy-book.oss-cn-hangzhou.aliyuncs.com/link/LuyinTu/Privacy-policy.html
8、连续订阅协议：https://copy-book.oss-cn-hangzhou.aliyuncs.com/link/LuyinTu/luyintu_ios_subscribe.html

丰富的体育新闻、高质量的文章、简单的阅读方式、专题式的内容显示、全面的数据分析、 奖品多多的直播间、专业的记者团队、高质量的网友评论、爱恨分明的表态、贴心的搜索功 能、一目了然的赛事对阵，种种这些汇聚成了专注 20 年体育新闻报道的——新浪体育 APP;

产品特色:

我们不只报道足球、篮球大项。像排球、乒乓球、赛车、围棋、高尔夫、网球、游泳、马拉 松、拳击搏击、体操、斯诺克、羽毛球、健美、飞镖、冰雪、彩票等项目的报道也是专业的!

比赛互动直播囊括 NBA、CBA 与英超、西甲、意甲、德甲、中超、亚冠、女排、男篮世界杯 等顶尖赛事尽在掌握;

现今 APP 中最受网友欢迎的前十俱乐部排名如下:利物浦、恒大、国安、曼联、巴萨、火箭、 湖人、勇士、鲁能、皇马;

现今 APP 中最受网友欢迎的前十运动员如下:哈登、詹姆斯、库里、武磊、杜兰特、C 罗、 梅西、威少、蒿俊闵、吴曦;

新浪体育旗下有 9 个自由赛事，大家都可报名参加:3×3 黄金赛事、5×5 足金联赛、高山 滑雪公开赛、青少年冰球联赛、未来之星马术大赛、青少年攀岩大赛、青少年击剑联赛、健 身健美大赛、智力运动会。做为老大哥的黄金联赛已经走过 4 个赛季，2019 赛季全网曝光 量可以达到 150 亿;

你的好评将让我们充满前进的动力

扫描仪功能详情：

-答案擦除：拍摄写有答案的文件，将答案擦除，只保留题目，方便用户进行二次使用；
-PDF转换Word：将PDF转换为可编辑的Word文件，方便在没有电脑时操作；
-图片转换PDF：将图片保存在一个PDF文件中，方便保存；
-照识数手机拍摄钢管钢筋等建材，智能扫描识别数量;
-手机测距手机摄像头测量物体长度或距离;
-OCR文字识别识别各国文字，拍摄纸质文档，识别后直接保存word文件;
-文档扫描拍摄纸质文档，生成电子PDF文件;
-证件照拍摄拍摄身份证、驾驶证、户口本、护照证件，生成电子A4纸格式图片;
-云端256GB大空间云端存储无忧;

用户协议：https://docs.qq.com/doc/p/37a75bead24eae8e494f322a1987f6c95f742919
隐私协议：https://docs.qq.com/doc/p/86945cd849995e5184368fc3c366c57de23c0f74



订阅相关：免费试用商品会在规定试用结束前24小时内，从相关的iTunes账户扣除订阅费用，请在试用结束前24小时内取消订阅。订阅商品生效后，您可在到期前24小时内取消订阅，到期前24小时内会从您指定的iTunes账户扣除订阅费用。

软件介绍：
运动世界（校园版）是一款鼓励全国高校莘莘学子走出宿舍，健康生活的运动平台。让运动更方便的走入各位学子的日常生活中。运动世界，运动触手可及！

产品特色：
@结合学校体质测试，碎片的跑步时间也能成为期末成绩
@随机点位路线，让每天遇到不一样的风景
@校内运动场地情况一目了然，预订场地，让运动随时进行。

[注意]
1.软件使用中需要获取GPS定位权限；
2.软件使用中需要访问相册、相机权限；
3.软件使用中需要访问蓝牙权限；
4.后台持续运行GPS会缩短电池使用寿命。

1. GPS positioning authority is required in software use;
2. Access to album and camera rights is required in software usage;
3. Access to bluetooth is required in software usage;
4. Continued use of GPS running in the background can dramatically decrease battery life.

